import React from "react";
import "./home.css"; 
import slider1 from "/images/slider1.jpg";

const ProfileCards = () => {
   
    return (
      <div className="container_h1 mx-auto p-4 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
      {[1, 2, 3].map((_, index) => (
        <div key={index} className={`profile-card card-${index + 1}`}></div>
      ))}
    </div>
    );
  };
  
  export default ProfileCards;
